export default function LoginForm(){
    return(
        <div>
            <form onSubmit = {handleSubmit}>
               <div>
               <input type='text'
                placeholder='Enter email...'
                value={email}
                onChange={(e) => { setUsername(e.target.value) }}
                />
                </div>
                <div>
                <input type='password'
                placeholder='Enter password...'
                value={password}
                onChange={(e) => { setPassword(e.target.value) }}
                />
                </div>
            </form>
        </div>
    )
}
